import './checkout-cart.style.css'
import React from 'react';

const CheckoutCart = ({imageUrl, name, quantity, price}) => {
    return (
        <div className='checkoutCart'>
            <img className='img' src={imageUrl}/>
            <span>{name}</span>
            <span>{quantity}</span>
            <span>${price}</span>
            <span>x</span>
        </div>
    );
}

export default CheckoutCart;
